import React from 'react';

function Footer() {
  return (
    <footer className="footer">
      <p>
        Created by the LetsDo Teams &copy; - Group 1 - Web Application Development - {new Date().getFullYear()}
      </p>
    </footer>
  );
}

export default Footer;
